import styled from 'styled-components'

export const Container = styled.div`
  width: 100%;
  padding: 0 1rem;
  max-width: 1200px;
  margin: 16px auto;
`

export const Wrapper = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;

  h1 {
    text-align: center;
  }

  .alert {
    margin-top: 16px;
  }

  .spinner {
    margin: 16px 0;
    background: re;
  }
`
